import React from "react";
import FavouritesList from "./FavouritesList.js";
import PlayOverview from "./PlayOverview.js";
import PlayData from "./PlayData.js";

const PlayDetails = (props) => {
    return (
        <div className="container">
            <FavouritesList favourites={props.favourites} deleteFromFavourites={props.deleteFromFavourites}/>
            <PlayOverview play={props.play} addToFavourites={props.addToFavourites}/>
            <PlayData play={props.play}/>
        </div>
    );
};

export default PlayDetails
